import React, { Component } from 'react';
import 'materialize-css/dist/css/materialize.min.css';
// Import Materialize
import M from "materialize-css";

//import MyCard from '../Components/MyCard'
// import TopBar from '../Components/TopBar'
// import MyCarousel from '../Components/MyCarousel'
import Drawer from '../Components/Drawer'

class Home extends Component {

    componentDidMount() {
        M.AutoInit()
    }

    render() {
        return (
            <div>
               <nav>
                <a href="#!" className="brand-logo"><Drawer /></a>
                <div className="nav-wrapper container">
                    <ul className="left">

                        <li>
                            {/* Dropdown Trigger */}
                            <a className="dropdown-trigger" href="#" data-target="dropdown1">All Categories
                        </a>
                            {/* Dropdown Structure */}
                            <ul id="dropdown1" className="dropdown-content">
                                <li><a href="http://localhost:3000/">Fantasy</a></li>
                                <li><a href="http://localhost:3000/">Medicine</a></li>
                                <li><a href="http://localhost:3000/">History</a></li>
                                <li><a href="http://localhost:3000/">Religious</a></li>
                                <li><a href="http://localhost:3000/">Biography</a></li>
                            </ul>
                        </li>
                        <li><i className="material-icons prefix">arrow_drop_down</i></li>

                        <li>
                            {/* Dropdown Trigger */}
                            <a className="dropdown-trigger" href="#" data-target="dropdown2">All Times
                        </a>
                            {/* Dropdown Structure */}
                            <ul id="dropdown2" className="dropdown-content">
                                <li><a href="#!">2019</a></li>
                                <li><a href="#!">2018</a></li>
                                <li><a href="#!">2017</a></li>
                                <li><a href="#!">2016</a></li>
                                <li><a href="#!">2015</a></li>
                            </ul>
                        </li>
                        <li><i className="material-icons prefix">arrow_drop_down</i></li>

                        <li><i className="material-icons prefix" htmlFor="icon_search"
                            style={{ paddingLeft: '3rem' }}>search</i></li>
                        <li><input placeholder="Search book" id="icon_search" type="search" className="validate" /></li>
                        <li></li>

                    </ul>

                    <ul id="nav-mobile" className="right hide-on-med-and-down">
                        <li><a href="google.com" className="brand-logo">Library </a></li>

                    </ul>
                </div>
            </nav>
            </div>

        )
    }
}

export default Home;
